import React from 'react';
import { useParams } from 'react-router-dom';

export const PropertyDetail = () => {
  const { id } = useParams();

  // In a real application, you would fetch property details using the id.
  const propertyDetails = {
    1: { title: 'Olivia Court', description: 'Built within a swift ten-minute drive from Victoria Island...', image: 'img/01-large.jpg', features: ['Luxury Living Rooms', 'Quality Hand-Made Furniture', 'Fully Fitted Kitchen', 'Uninterrupted Power Supply', 'Swimming Pool', 'Fitness Center and Lounge'] },
    2: { title: 'Property 2', description: 'Details about Property 2', image: 'img/02-large.jpg', features: ['Feature 1', 'Feature 2'] },
    3: { title: 'Property 3', description: 'Details about Property 3', image: 'img/03-large.jpg', features: ['Feature 1', 'Feature 2'] },
    // Add more properties here...
  };

  const property = propertyDetails[id];

  if (!property) {
    return <div>Property not found.</div>;
  }

  return (
    <div className="property-detail-container">
      <div className="property-detail-content">
        <div className="property-detail-left">
          <img src={property.image} alt={property.title} className="property-image-large" />
          <iframe className="property-video" title="Property Video" width="560" height="315" src="https://www.youtube.com/embed/example_video" frameBorder="0" allow="autoplay; encrypted-media" allowFullScreen></iframe>
        </div>
        <div className="property-detail-right">
          <h2>{property.title}</h2>
          <ul className="property-features">
            {property.features.map((feature, index) => (
              <li key={index}>{feature}</li>
            ))}
          </ul>
          <button className="read-brochure-btn">Read Project Brochure</button>
        </div>
      </div>
      <div className="property-detail-description">
        <h3>Introducing {property.title}</h3>
        <p>{property.description}</p>
      </div>
    </div>
  );
};

export default PropertyDetail;
